INSERT INTO `option` VALUES (1,'Narzut kostka na metry (%)','15','Narzut cenowy na kostkę liczoną na metry kwadratowe w procentach.','nknm'),(2,'Zgody do zamówienia/oferty','1. Klient jest zobowiązany do składania zamówienia w formie pisemnej podając dane zgodnie z ofertą firmy. Wszelkie koszty dodatkowe wynikające ze zmiany zamówienia w trakcie realizacji lub podania błędnych informacji ponosi Zamawiający.\r\n2. Przy realizacji zamówień publicznych i specjalnych zamawiający zobowiązany jest do złożenia na piśmie specyfikacji technicznej zamawianego wyrobu do wcześniejszej akceptacji przez Producenta.\r\n3. kołodomu.pl s.c. za wszelkie usługi transportowo-wyładowcze jest pobierana dodatkowa opłata. W uzasadnionych przypadkach kierowca ma prawo do odmowy wjazdu w celu rozładunku. \r\n4. W sytuacji, kiedy dostawcą towaru na wskazane miejsce jest kołdomu.pl s.c. kupujący zobowiązuje się do sprawdzenia dostawy przy rozładunku (ilość, jakość, zgodność z zamówieniem); ewentualne braki wpisuje w Dokumencie WZ kołodomu.pl s.c. Towar odebrany bez zastrzeżeń uznaje się jako wolny od wad widocznych.\r\n5. W przypadku stwierdzenia wad ukrytych lub niezgodności wynikłych przed lub w trakcie wykonywania inwestycji, Nabywca wstrzymuje się z układaniem wyrobu i powiadamia Sprzedawcę w terminie niezwłocznym pod rygorem utraty uprawnień z tytułu rękojmi (Art.563. KC).\r\n6. W przypadku opóźnienia terminu zapłaty kołodomu.pl s.c. nalicza odsetki w wysokości odsetek ustawowych. Za datę płatności uznaje się dzień, w którym środki płatnicze wpłyną na konto kołodomu.pl s.c. lub zostaną opłacone w siedzibie firmy kołodomu.pl s.c.\r\n7. Jeżeli Klient kupuje niepełny pakiet kostki brukowej, kołodomu.pl s.c. dolicza 15 % wartości danego towaru, natomiast w przypadku zakupu niepełnego pakietu galanterii betonowej doliczane jest 10% wartości towaru.\r\n8. Jeżeli towar jest sprzedawany na drewnianych paletach zwrotnych z logo producenta pobierana jest umowna kaucja. Zwrot kaucji następuje po dostarczeniu palet w dobrym stanie technicznym do siedziby Firmy kołodomu.pl s.c. W przypadku nie zwrócenia właściwej palety w terminie 60 dni od daty zakupu kołdomu.pl s.c. nie ma obowiązku odkupienia jej w cenie sprzedaży.\r\n9. Za wyjątkiem sprzedaży konsumenckiej odpowiedzialność z tytułu rękojmi za wady fizyczne towaru jest wyłączona (Art.558 par. 1 KC).\r\n10.Przy stałej współpracy szczegółowe warunki sprzedaży są zawarte w odrębnych umowach.\r\nKupujący zobowiązany jest zapoznać się z treścią warunków sprzedaży, informacją o produkcie i z warunkami gwarancji.','Warunki zakupu do akceptacji','order_agreements'),(3,'przeładunek','160','Kwota przeładunku HDS','przeladunek'),(4,'Doładunek','60','Dwa miejsca załadunku','doladunek');
